import React from 'react';
import { GridProvider } from './GridContext';
import Grid from './Grid';
import './App.css';


const gridContainerStyle = {
  display: 'flex',
  justifyContent: 'center',
};


const App = () => (
  <GridProvider>
    <div className='grid-container'>
      <Grid />
    </div>
  </GridProvider>
);

export default App;
